public void testAllTermDocs() throws IOException {
  IndexReader reader = openReader();
  int NUM_DOCS = 2;
  TermDocs td = reader.termDocs(null);
  for(int i=0;i<NUM_DOCS;i++) {
    assertTrue(td.next());
    assertEquals(i, td.doc());
    assertEquals(1, td.freq());
  }
  td.close();
  reader.close();
}

